'''Matthias Vorseth''' is the author of ''[[Rada's census]]'',{{CiteNPC|npc=Matthias Vorseth|loc=Rada's census|quote=Census of King Rada III, by Matthias Vorseth.|notes=Item examine text.}} a [[List of books|book]] found in the [[Arceuus Library]]. Matthias created the census by the command of [[King Rada III]] sometime between 6th BA and 5th BA, documenting all skilled peoples, animals and estates of the Lords of the settlement of Kourend. {{CiteNPC|npc=Matthias Vorseth|loc=Rada's census|quote=By the command of His Royal Highness King Rada III, here follows the complete census of the skilled peoples, animals and estates of the Lords of the settlement of Kourend.}}

